    value: 'There were two (2) contributions made by CMSA that would have caused a
      discrepancy in the opening and closing balances of our filing.  In 2006, we
      made a contribution to Capito for Congress via check.  However, the check was
      not cashed.  Further, in the 2Q of 2007, a contribution check was send to Baker
      for Congress - this check was not cashed as well.  Both checks were reissued
      in the 3rd Q of 2007.  In order to account for this adjustment, we amended the
      previous report and indicated the appropriate negative entries in order to balance
      the account.  Please note that the closing cash for the 6/30/07 filing and opening
      cash for the 12/31/07 is equal to $132,082.80.  As of 10/16/08, subsequent check
      that was reissued for BAC PAC (Congressman Baker) was not cashed, and therefore
      will be voided.  Please let us know if you require any further information.      We
      added the Calendar YTD total from our previous report to the current total this
      period figure and came up with the correct column B totals on the report.

